import React, { useState } from 'react';
import PropTypes from 'prop-types';
import { useNavigate } from 'react-router-dom';
import LeftBar from '../../component/leftbar/leftbar';
import { makeStyles } from '@material-ui/core/styles';
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  AppBar,
  Tabs,
  Tab,
  Box,
  Menu,
  MenuItem
} from '@material-ui/core';
import './myprograme.css';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper,
  },
}));

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          {children}
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function Myprograme() {
  const classes = useStyles();
  const [anchorEl, setAnchorEl] = useState(null);
  const [value, setValue] = useState(0);
  const [value2, setValue2] = useState(0);
  const navigate = useNavigate();

  const handleClick = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleClose = () => {
    setAnchorEl(null);
  };

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  const handleChange2 = (event, newValue) => {
    setValue2(newValue);
  };

  return (
    <div className='container' id='MyPrograme'>
      <div className='leftbox'>
        <LeftBar tabNav="MyPrograme" />
      </div>
      <div className='maincenter'>
        <AppBar position="static">
          <Paper square>
            <Tabs
              value={value}
              onChange={handleChange}
              indicatorColor="secondary"
              textColor="secondary"
            >
              <Tab label="Year 1" />
              <Tab label="Year 2" />
              <Tab label="Year 3" />
              <Tab label="Year 4" />
            </Tabs>
          </Paper>
        </AppBar>

        <TabPanel value={value} index={0}>
          <div className='tabbox'>
            <TableContainer className='tablebox'>
              <Table aria-label="simple table">
                <TableHead>
                  <TableRow>
                    <TableCell align="center">ID</TableCell>
                    <TableCell align="center">Module Name</TableCell>
                    <TableCell align="center">Start Time</TableCell>
                    <TableCell align="center">End Time</TableCell>
                    <TableCell align="center">Grade</TableCell>
                    <TableCell align="center">Operation</TableCell>
                  </TableRow>
                </TableHead>
                <TableBody>
                  {/* Your table rows for Year 1 */}
                </TableBody>
              </Table>
            </TableContainer>
          </div>
        </TabPanel>

        <TabPanel value={value} index={1}>
          <div className='tabbox'>
            <div className='tiptxt'>
              xxxxxxxxxxxxxxxxxx
            </div>
            <AppBar position="static">
              <Paper square>
                <Tabs
                  value={value2}
                  onChange={handleChange2}
                  indicatorColor="secondary"
                  textColor="secondary"
                >
                  <Tab label="Software" />
                  <Tab label="Mechanical" />
                  <Tab label="Electronics Hardware" />
                  <Tab label="Electromechanical" />
                </Tabs>
              </Paper>
            </AppBar>

            {/* Year 2 content with nested tabs */}
            <TabPanel value={value2} index={0}>
              <TableContainer className='tablebox'>
                <Table aria-label="simple table">
                  <TableHead>
                    <TableRow>
                      <TableCell align="center">ID</TableCell>
                      <TableCell align="center">Module Name</TableCell>
                      <TableCell align="center">Start Time</TableCell>
                      <TableCell align="center">End Time</TableCell>
                      <TableCell align="center">Grade</TableCell>
                      <TableCell align="center">Operation</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {/* Your table rows for Software modules */}
                  </TableBody>
                </Table>
              </TableContainer>
            </TabPanel>
            {/* Add other TabPanels for other Year 2 content */}
          </div>
        </TabPanel>

        {/* Add TabPanels for Year 3 and Year 4 */}
      </div>
    </div>
  );
}

export default Myprograme;
